// src/components/Footer.js

import React from 'react';
import '../styles/Footer.css'; // Importe o CSS do footer para estilização

const Footer = () => {
  return (
    <footer className="footer bg-dark text-white text-center p-3">
      <p>© 2024 Health Horizon - Todos os direitos reservados</p>
    </footer>
  );
};

export default Footer;
